import Card from "./components/Card";

function App() {
  return (
    <div>
      <Header />
      <body role="body" style={{ paddingTop: "200px" }}>
        This is the body
        <Card />
      </body>
      <Demo />
      <FooterTop />
      <FooterBottom />
    </div>
  );
}

export default App;
